// components/TeamCarousel.tsx
import React, { useRef, useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import TeamMemberCard from './TeamMemberCard';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { IconProp } from '@fortawesome/fontawesome-svg-core';
import { faChevronLeft, faChevronRight } from '@fortawesome/free-solid-svg-icons';

interface TeamMember {
  name: string;
  role: string;
  bio: string;
  icon: string;
  image: string;
}

interface TeamCarouselProps {
  teamMembers: TeamMember[];
}

const TeamCarousel: React.FC<TeamCarouselProps> = ({ teamMembers }) => {
  const carouselRef = useRef<HTMLDivElement>(null);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [cardsPerView, setCardsPerView] = useState(1);
  const maxIndex = Math.max(0, teamMembers.length - cardsPerView);

  // Calculate number of cards to show based on screen width
  useEffect(() => {
    const updateCardsPerView = () => {
      const width = window.innerWidth;
      if (width >= 1024) {
        setCardsPerView(3); // lg: 3 cards
      } else if (width >= 768) {
        setCardsPerView(2); // md: 2 cards
      } else {
        setCardsPerView(1); // sm: 1 card
      }
    };

    updateCardsPerView();
    window.addEventListener('resize', updateCardsPerView);
    return () => window.removeEventListener('resize', updateCardsPerView);
  }, []);

  // Update maxIndex when cardsPerView changes
  useEffect(() => {
    setCurrentIndex((prev) => Math.min(prev, Math.max(0, teamMembers.length - cardsPerView)));
  }, [cardsPerView, teamMembers.length]);

  // Handle navigation
  const scrollToIndex = (index: number) => {
    setCurrentIndex(Math.max(0, Math.min(index, maxIndex)));
    if (carouselRef.current) {
      const cardWidth = carouselRef.current.querySelector('.team-card')?.clientWidth || 0;
      carouselRef.current.scrollTo({
        left: index * cardWidth,
        behavior: 'smooth',
      });
    }
  };

  const next = () => scrollToIndex(currentIndex + 1);
  const prev = () => scrollToIndex(currentIndex - 1);

  return (
    <div className="relative w-full max-w-5xl mx-auto py-8">
      {/* Carousel Container */}
      <div
        ref={carouselRef}
        className="flex overflow-x-auto snap-x snap-mandatory scroll-smooth hide-scrollbar py-2"
        style={{ scrollSnapType: 'x mandatory' }}
      >
        <motion.div
          className="flex gap-4 md:gap-6"
          animate={{ x: `-${currentIndex * (100 / cardsPerView)}%` }}
          transition={{ type: 'spring', stiffness: 100, damping: 20 }}
        >
          {teamMembers.map((member, index) => (
            <div
              key={member.name}
              className="team-card flex-none w-[80%] md:w-[45%] lg:w-[32%] snap-center"
            >
              <TeamMemberCard
                name={member.name}
                role={member.role}
                bio={member.bio}
                icon={member.icon}
                image={member.image}
              />
            </div>
          ))}
        </motion.div>
      </div>

      {/* Navigation Arrows */}
      <AnimatePresence>
        {teamMembers.length > cardsPerView && (
          <>
            {currentIndex > 0 && (
              <motion.button
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                exit={{ opacity: 0 }}
                onClick={prev}
                className="absolute left-2 md:left-4 top-1/2 transform -translate-y-1/2 bg-blue-600 hover:bg-blue-700 p-2 md:p-3 rounded-full shadow-lg transition-all duration-300 hover:scale-110 flex items-center justify-center w-8 h-8 md:w-10 md:h-10"
                aria-label="Previous team member"
              >
                <FontAwesomeIcon 
                  icon={faChevronLeft} 
                  className="text-white text-sm md:text-lg" 
                />
              </motion.button>
            )}
            {currentIndex < maxIndex && (
              <motion.button
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                exit={{ opacity: 0 }}
                onClick={next}
                className="absolute right-2 md:right-4 top-1/2 transform -translate-y-1/2 bg-blue-600 hover:bg-blue-700 p-2 md:p-3 rounded-full shadow-lg transition-all duration-300 hover:scale-110 flex items-center justify-center w-8 h-8 md:w-10 md:h-10"
                aria-label="Next team member"
              >
                <FontAwesomeIcon 
                  icon={faChevronRight} 
                  className="text-white text-sm md:text-lg" 
                />
              </motion.button>
            )}
          </>
        )}
      </AnimatePresence>

      {/* Dots Navigation */}
      {teamMembers.length > cardsPerView && (
        <div className="flex justify-center mt-8 space-x-3">
          {Array.from({ length: maxIndex + 1 }).map((_, index) => (
            <button
              key={index}
              onClick={() => scrollToIndex(index)}
              className={`w-3 h-3 rounded-full transition-all duration-300 ${
                currentIndex === index 
                  ? 'bg-blue-500 scale-110' 
                  : 'bg-gray-300 hover:bg-gray-400'
              }`}
              aria-label={`Go to team member set ${index + 1}`}
            />
          ))}
        </div>
      )}
    </div>
  );
};

export default TeamCarousel;
